script: |
  super -f text -I q3768.spq | sort > q3768.out

inputs:
  - name: q3768.spq
    data: |
      SELECT DISTINCT + - col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 + + + 75 + - 82 * 25 BETWEEN - col2 AND - + col1;
  - name: tab2

outputs:
  - name: q3768.out
    data: |
      -46
      -64
      -75
